  'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Welcome to eZ Publish Platform 5.2, the Aconcagua release.�</line><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">This release brings several new features and general improvements on the foundations introduced in eZ Publish Platform 5</line></paragraph></section>',
