  'data_float' => '0',
  'data_int' => '1045487555',
  'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><section><header>Key Selected New Features in eZ Publish 5</header><paragraph>Our objective is to provide you the most compelling Multichannel Web and Customer Experience Platform. With the eZ Publish 5 architecture we encompass a thoroughly revamped platform, which facilitates better user experiences, increases productivity, and enables your digital business model sustainably. Underlying and enabling these ambitious goals is a completely new but thoroughly backward compatible product architecture, along with a host of user interface (UI) enhancements.</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">New Public API � Streamlined PHP Interface to eZ Publish</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Enhanced REST API � eZ Publish as a Web Service</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">New high-performance framework for Web projects � Symfony full stack</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">New modern template engine � Twig based</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Still totally backward compatible with 4.x legacy architecture</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Many new and updated extensions in the eZ Market</paragraph></li></ul></paragraph><paragraph>For further information visit <link url_id="40">www.ez.no,</link> the documentation: <link url_id="40">doc.ez.no</link> and the <link url_id="40">share.ez.no</link> community.</paragraph></section></section>',
