  'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Product Support is the core service of the eZ Publish Enterprise subscription, available to all our customers, with differing initial response times depending on the subscription service level.�Subscribing to eZ Publish Enterprise gives you the option of requesting assistance from our product support team.</paragraph></section>',
