ining business and opens doors to the eZ\'s ecosystem of partners and customers, wh...</paragraph><paragraph><link url_id="48">more �</link></paragraph></section></section><section><section><header><link url_id="49">Online Certification</link></header><paragraph>Most trainings are combined with the option of an online certification. eZ systems offers to perform an online exam with an automated tool.</paragraph></section></section></section>',
