<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph><embed align="right" view="embed" size="listitem" custom:offset="0" custom:limit="5" object_id="83"/></paragraph><section><section><section><header>The best of two worlds</header><paragraph>eZ Publish Enterprise is the best choice for organizations employing eZ Publish in a professional environment. eZ Publish Enterprise comes with all the benefits of the open source eZ Publish community project, which is founded on innovative software created by eZ in collaboration with a global user base. The software is based on open standards, but packaged with a professional software and services package that is standardized, stable and solid. The Enterprise subscription includes support and bug fix guarantees, monitoring, and other value-added services.&#xA0;</paragraph><paragraph><anchor name="eztoc170091_0_2"/></paragraph></section></section></section><section><section><section><header>The license that fits</header><paragraph>Clear, concise intellectual property framework is another competitive advantage that sets eZ Publish Enterprise apart. Our customers are free to select the license that fits their business: either the traditional General Public License (GPL), or the professional Personal Use License (PUL). In either case, eZ Systems controls the intellectual property rights of the software, so there&#x2019;s no concern about conflicts of interest between software contributors.</paragraph><paragraph><anchor name="eztoc170091_0_3"/></paragraph></section></section></section><section><section><section><header>Access to a dedicated Service Portal</header><paragraph>Your subscription to eZ Publish Enterprise entitles you to a dedicated Service Portal for communication and collaboration with our teams. In addition, you will receive secured extranet access for each service user for streamlined communication with eZ.</paragraph><paragraph>Important features of the Service Portal includes a support issue tracker, detailed summary of your subscription and its certified software, as well as access to maintenance and monitoring information.</paragraph><paragraph>Product Support is the core service of the eZ Publish Enterprise subscription, available to all our customers with differing initial response times depending on the subscription service level.</paragraph></section></section></section></section>
